-- ----------------------------
-- Table structure for idioma
-- ----------------------------
DROP TABLE IF EXISTS idioma;
CREATE TABLE idioma (
  idioma_id integer NOT NULL,
  nome char(20) NOT NULL,
  ultima_atualizacao timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (idioma_id)
);

-- ----------------------------
-- Records of idioma
-- ----------------------------

-- ----------------------------
-- Table structure for filme
-- ----------------------------
DROP TABLE IF EXISTS filme;
CREATE TABLE filme (
  filme_id integer NOT NULL,
  titulo varchar(255) NOT NULL,
  descricao text,
  ano_de_lancamento integer DEFAULT NULL,
  idioma_id integer NOT NULL,
  idioma_original_id integer DEFAULT NULL,
  duracao_da_locacao integer NOT NULL DEFAULT '3',
  preco_da_locacao decimal(4,2) NOT NULL DEFAULT '4.99',
  duracao_do_filme integer DEFAULT NULL,
  custo_de_substituicao decimal(5,2) NOT NULL DEFAULT '19.99',
  classificacao varchar(5) DEFAULT 'G',
  recursos_especiais varchar(255) DEFAULT NULL,
  ultima_atualizacao timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (filme_id),
  CONSTRAINT filme_ibfk_1 FOREIGN KEY (idioma_id) REFERENCES idioma (idioma_id) ON UPDATE CASCADE,
  CONSTRAINT filme_ibfk_2 FOREIGN KEY (idioma_original_id) REFERENCES idioma (idioma_id) ON UPDATE CASCADE
);

-- ----------------------------
-- Records of filme
-- ----------------------------

-- ----------------------------
-- Table structure for filme_ator
-- ----------------------------
DROP TABLE IF EXISTS filme_ator;
CREATE TABLE filme_ator (
  ator_id integer  NOT NULL,
  filme_id integer  NOT NULL,
  ultima_atualizacao timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (ator_id,filme_id),
  CONSTRAINT filme_ator_ibfk_1 FOREIGN KEY (ator_id) REFERENCES ator (ator_id) ON UPDATE CASCADE,
  CONSTRAINT filme_ator_ibfk_2 FOREIGN KEY (filme_id) REFERENCES filme (filme_id) ON UPDATE CASCADE
);

